DROP SCHEMA IF EXISTS Walmart;

CREATE DATABASE IF NOT EXISTS Walmart;

USE Walmart;

CREATE TABLE IF NOT EXISTS Region(
	regionId INTEGER NOT NULL,
    `name` VARCHAR(100) NOT NULL,
    state VARCHAR(100) NOT NULL,
    dmzCount INTEGER,
    pipeCount INTEGER,
    residSA INTEGER,
    indusSA INTEGER, 
    otherSA INTEGER, 
    PRIMARY KEY (regionId)
);

